INSERT INTO `CookingStage` (`Id`, `Description`, `DishId`, `TimeInMinutes`) VALUES
(6, 'Сыр натереть на мелкой терке, добавить муку, яйцо. Перемешать. Сформировать сырные палочки.', 1, 30),
(7, 'Обжарить их в растительном масле до золотистого цвета.', 1, 20),
(8, 'Картошку предварительно сварим в мундире.', 2, 30),
(10, 'Отварную картошку разрежем пополам.', 2, 5),
(11, 'Сыр и колбасу натрем на терке.', 2, 10),
(12, 'Из половинок картофеля аккуратно удалим внутреннюю часть чайной ложкой.', 2, 5),
(13, 'Смешаем мякоть картофеля с сыром и колбасой. Добавим соль и перец по вкусу.', 2, 5),
(14, 'Добавим сметану и перемешаем начинку.', 2, 5),
(15, 'Наполним половинки картофеля приготовленной начинкой.', 2, 5),
(16, 'Форму для запекания смажем растительным или сливочным маслом. Выложим в форму фаршированную картошку с сыром и колбасой и поставим в духовку, разогретую до 200 градусов. Будем запекать фаршированный картофель в духовке 10-15 минут.', 2, 20),
(17, 'Готовый запеченный картофель украсим свежей зеленью.', 2, 5),
(18, 'Куриное филе вымыть и обсушить.', 3, 5),
(19, 'Филе нарезать кусочками.', 3, 10),
(20, 'Лук репчатый очистить, помыть и мелко нарезать кубиками.', 3, 10),
(21, 'Разогреть сковороду. Налить растительное масло. Выложить филе и лук, жарить, помешивая, на среднем огне до готовности (около 20 минут).', 3, 25),
(22, 'Посолить, поперчить, добавить специи. Перемешать. Добавить сметану (или сливки). Перемешать. Накрыть крышкой. Довести до кипения и снять с огня. Оставить под крышкой еще на 5-10 минут.', 3, 20),
(23, 'Налить в кастрюлю воду, вскипятить, посолить воду. В кипящую воду опустить макаронные изделия, перемешать, налить 2 ч. ложки растительного масла. Дать вскипеть, перемешать. Варить на среднем огне до готовности, согласно инструкции (7-10 минут).', 3, 20),
(24, 'Откинуть на дуршлаг готовые макароны. Дать воде стечь.', 3, 5),
(25, 'Выложить пасту к курице. Хорошо перемешать пасту с куриной грудкой и можно подавать.', 3, 5),
(26, 'Отварить яйца', 4, 15),
(27, 'Колбасу нарезать кубиками.', 4, 5),
(28, 'Яйца нарезать кубиками.', 4, 5),
(29, 'Сыр натереть на тёрке.', 4, 10),
(30, 'Соединить колбасу, сыр, яйца и кукурузу.', 4, 5),
(31, 'Все ингредиенты смешать и заправить салат \"Ежик\" майонезом.', 4, 5),
(32, 'Кофе пересыпьте в глубокую миску или чашу для взбивания.', 5, 5),
(33, 'Залейте кофе холодной кипячёной водой.', 5, 2),
(34, 'Миксером взбейте воду с кофе в лёгкую пену, около минуты.', 5, 3),
(35, 'Всыпьте сахар.', 5, 2),
(37, 'Теперь миксером на высокой скорости взбейте кофе с водой и сахаром до стабильной, крепкой и устойчивой пены. На это понадобится около 3 минут.', 5, 3),
(38, 'Разложите кофейную пену в креманки или стаканы и подайте к столу.', 5, 5);

